import { ROUTE_HOME, ROUTE_TEAM, ROUTE_EFFECTS } from 'consts/routes';

export function getTopbarVariantOnSubpage(pathname: string): boolean {
    switch (pathname) {
        case ROUTE_HOME:
            return false;
        case ROUTE_TEAM:
            return true;
        case ROUTE_EFFECTS:
            return false;
        default:
            return true;
    }
}
